//Cart page Component

//Module import
import React, { Component } from 'react';

//Style import
import './Cart.css';

class Cart extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  displayCart = () => {
    const cart = this.props.cart.map((element, index) => (
      <ul>
        <li>{element.name}</li>
        <li>{element.price}</li>
      </ul>
    ));
  };
  render() {
    return (
      <div>
        <ul>{this.displayCart()}</ul>
      </div>
    );
  }
}

export default Cart;
